import axios from "axios";
import { AxiosResponse } from "axios";

const getDetailsAboutFilm = (id:number):Promise<AxiosResponse> => axios.get('https://api.tvmaze.com/shows/' + id); // (id) => / + id  https://api.tvmaze.com/shows/1

export default getDetailsAboutFilm;
